import React, { Fragment,useState } from 'react';
import Card from '../UI/Card';
import classes from './Employee.module.css';

const Employee = (props)=>{
    const[isClicked,setIsclicked]=useState(false);
    const onclickedhandler=()=>{
      setIsclicked(true);

    }
    const onclickedNameHandler=()=>{
      alert(props.department)
    }
    return (
      <Card >
        <li className={classes.Employee}  onClick={onclickedhandler} >


          {!isClicked &&<p >{props.name}</p>}

         {isClicked && <Fragment>
          <p onClick={onclickedNameHandler}>{props.name}</p>
           <p className={classes.role}>{props.id}</p>
            <p className={classes.role}>{props.age}</p>
            <p className={classes.role}>{props.location}</p>
            <p className={classes.role}>{props.role}</p>
          </Fragment>}


      </li>
      </Card>
    )
}
export default Employee;
